INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3001100, "2024/10/31 12:00:00", 100, 130011, "ヤマト", 0.0, 2.1, 1, "2030/01/01 14:59:59", 2, -416.5, 3001, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3001101, "2024/10/31 12:00:00", 101, 130011, "ヤマト", 0.0, 5.68, 4, "2030/01/01 14:59:59", 2, -416.5, 3001, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3001102, "2024/10/31 12:00:00", 102, 130011, "ヤマト", 0.0, 0.0, 1, "2030/01/01 14:59:59", 1, -416.5, 3001, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002100, "2024/10/31 12:00:00", 100, 130211, "フブキ", 0.0, 0.0, 1, "2030/01/01 14:59:59", 1, -416.5, 3002, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002101, "2024/10/31 12:00:00", 101, 130211, "フブキ", 0.0, 0.0, 1, "2030/01/01 14:59:59", 1, -416.5, 3002, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002102, "2024/10/31 12:00:00", 102, 130211, "フブキ", 0.0, 8.53, 5, "2030/01/01 14:59:59", 2, -416.5, 3002, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002103, "2024/10/31 12:00:00", 103, 130211, "フブキ", 0.0, 5.67, 7, "2030/01/01 14:59:59", 1, -416.5, 3002, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002104, "2024/10/31 12:00:00", 104, 130211, "フブキ", 0.0, 0.0, 1, "2030/01/01 14:59:59", 1, -416.5, 3002, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002300, "2024/10/31 12:00:00", 300, 130211, "フブキ", 0.0, 0.0, 3, "2030/01/01 14:59:59", 3, -416.5, 3004, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3002400, "2024/10/31 12:00:00", 301, 130211, "フブキ", 0.0, 0.0, 7, "2030/01/01 14:59:59", 7, -416.5, 3005, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3003200, "2024/10/31 12:00:00", 200, 130211, "フブキ", 0.0, 4.4, 2, "2030/01/01 14:59:59", 1, -416.5, 3003, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3003201, "2024/10/31 12:00:00", 201, 130211, "フブキ", 0.0, 0.0, 7, "2030/01/01 14:59:59", 7, -416.5, 3003, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ");
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3003202, "2024/10/31 12:00:00", 202, 130211, "フブキ", 0.0, 5.6, 1, "2030/01/01 14:59:59", 2, -416.5, 3003, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪");
